CREATE DATABASE /*!32312 IF NOT EXISTS*/ foodwaste /*!40100 DEFAULT CHARACTER SET utf8mb4 */;
USE foodwaste;

DROP TABLE IF EXISTS foodlist;
CREATE TABLE `foodlist` (
  `id` int NOT NULL AUTO_INCREMENT,
  `foodGroup` varchar(50) DEFAULT NULL,
  `foodName` varchar(50) DEFAULT NULL,
  `kj` int DEFAULT NULL,
  `kcal` int DEFAULT NULL,
  `protein` float DEFAULT NULL,
  `fat` float DEFAULT NULL,
  `carb` float DEFAULT NULL,
  `fiber` float DEFAULT NULL,
  `waste` float DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1080 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS partnerlogin;
CREATE TABLE `partnerlogin` (
  `id` int NOT NULL AUTO_INCREMENT,
  `mail` varchar(100) DEFAULT NULL,
  `partnerPassword` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS partners;
CREATE TABLE `partners` (
  `id` int NOT NULL AUTO_INCREMENT,
  `navn` varchar(100) DEFAULT NULL,
  `postnr` int DEFAULT NULL,
  `partnerLogin` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `navn` (`navn`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS postnrtable;
CREATE TABLE `postnrtable` (
  `id` int NOT NULL AUTO_INCREMENT,
  `postNr` int DEFAULT NULL,
  `city` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `postNr` (`postNr`),
  UNIQUE KEY `city` (`city`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE OR REPLACE VIEW `foodcategories` AS select distinct `foodlist`.`foodGroup` AS `foodGroup` from `foodlist`;

